    false,nt"url": null,nt"notes": "Multibeam backscatter imagery extracted
    from gridded bathymetry of the lagoon and shelf environments at Kingman Reef, Pacific
    Island Areas, Central Pacific. These data provide coverage between 2 and 3500 meters.
    The backscatter dataset includes data collected using Simrad EM300 and Reson 8101
    multibeam sonars. The sonars frequencies are 30 kHz and 240 kHz respectively and
    the backscatter data from each sonar are processed and gridded separately. These
    metadata are for the 1 m grid cell size Reson 8101 multibeam backscatter data only.",nt"license_title":
